import React from 'react';
import './Navbar.css';
import { FaWifi } from 'react-icons/fa';
import wifiIcon from './assets/wifi.svg';
import batteryIcon from './assets/battery.svg';

const Navbar = () => {
  return (
    <div className="navbar-container">
      <div className="navbar-left">
        <img className='logo' src="./assets/Apple Logo.svg" alt="Logo" />
        <span className="navbar-name">Marcus Ramos</span>
      </div>
      <div className="navbar-right">
        <FaWifi className="navbar-icon" />
        <img className="navbar-icon" src={batteryIcon} alt="Battery" />
        <p className="navbar-text">Sat Dec 28 4:18 PM</p>
      </div>
    </div>
  );
};

export default Navbar;
